void comb(int n, int k, vector<int>& used, int index) {

    if (index == k) {
        for (int i = 0; i < k; ++i) {
            cout << used[i] << " ";
        }
        cout << endl;
        return;
    }

    for (int i = 1; i <= n; ++i) {
        used[index] = i;
        comb(n, k, used, index + 1);
    }
}

int main() {
    int n, k;
    cin >> n >> k;

    vector<int> used(k);
    comb(n, k, used, 0);

    return 0;
}